  [],\n\t\"num_tags\": 0,\n\t\"name\": \"noaa-office-for-coastal-management-coastal-inundation-digital-elevation-model-san-juan-puerto-r\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These data were created as part of the
  National Oceanic and Atmospheric Administration Office for Coastal Management's
  efforts to create an online mapping viewer called the Sea Level Rise and Coastal
  Flooding Impacts Viewer. It depicts potential sea level rise and its associated
  impacts on the nation's coastal areas. The purpose of the mapping viewer is to provide
  coastal managers and scientists with a preliminary look at sea level rise (slr)
  and coastal flooding impacts. The viewer is a screening-level tool that uses nationally
  consistent data sets and analyses. Data and maps provided can be used at several
  scales to help gauge trends and prioritize actions for different scenarios. The
  Sea Level Rise and Coastal Flooding Impacts Viewer may be accessed at: http://www.coast.noaa.gov/slr
  This metadata record describes the digital elevation model (DEM), which is a part
  of a series of DEMs produced for the National Oceanic and Atmospheric Administration
  Office for Coastal Management's Sea Level Rise and Coastal Flooding Impacts Viewer
  described above. The DEMs created for this project were developed using the NOAA
  National Weather Service's Weather Forecast Office (WFO) boundaries. This DEM includes
  the best available data known to exist at the time of DEM creation that met project
  specifications for the San Juan, PR WFO, which includes the coastlines of Puerto
  Rico. For Puerto Rico, the DEM was derived from: 1. 2004 US Army Corps of Engineers
  (USACE) Joint Airborne Lidar Bathymetry Technical Center of Expertise (JALBTCX)
  Puerto Rico Lidar, collected January 10 - February 8, 2004, vertical accuracy is
  18.6 cm Root Mean Square Error (RMSE) 2. FEMA ADCIRC Composite DEM for Puerto Rico
  3. NOAA National Geophysical Data Center (NGDC) Tsunami Inundation DEMs a. Guayama,
  PR 1/3 arc-second MHW DEM: Date completed 20070622 b. Ponce, PR 1/3 arc-second MHW
  DEM: Date completed 20070622 c. Fajardo, PR 1/3 arc-second MHW DEM: Date completed
  20070622 d. San Juan, PR 1/3 arc-second MHW DEM: Date completed 20070622 e. Arecibo,
  PR 1/3 arc-second MHW DEM: Date completed 20070622 f. Mayaguez, PR 1/3 arc-second
  MHW DEM: Date completed 20060505 Hydrographic breaklines used in the creation of
  this DEM were created by the NOAA Office for Coastal Management. For Puerto Rico,
  the hydrographic breaklines were delineated from the lidar intensity imagery generated
  from the lidar datasets and additional imagery that matched the years of the lidar.
  The DEMs are hydro flattened such that water elevations are less than or equal to
  0 meters. The DEM is referenced vertically to the North American Vertical Datum
  of 1988 (NAVD88) with vertical units of meters and horizontally to the North American
  Datum of 1983 (NAD83). The resolution of the DEM is approximately 10 meters.\",\n\t\"owner_org\":
